import React, { useState, useEffect } from 'react';
import ChatInterface from './components/ChatInterface';
import CareerRoadmapFlow from './components/CareerRoadmapFlow';
import { careerAPI } from './services/api';
import { AlertCircle, CheckCircle, Wifi, WifiOff } from 'lucide-react';

function App() {
  const [messages, setMessages] = useState([]);
  const [isLoading, setIsLoading] = useState(false);
  const [currentLearningPath, setCurrentLearningPath] = useState(null);
  const [backendStatus, setBackendStatus] = useState('unknown');
  const [error, setError] = useState(null);

  // Check backend connection on component mount
  useEffect(() => {
    checkBackendHealth();
  }, []);

  // Debug: Monitor learning path state changes
  useEffect(() => {
    console.log('ðŸ—ºï¸ FRONTEND: Learning path state changed to:', currentLearningPath ? 'has data' : 'empty');
  }, [currentLearningPath]);

  const checkBackendHealth = async () => {
    try {
      await careerAPI.testConnection();
      setBackendStatus('connected');
    } catch (error) {
      setBackendStatus('disconnected');
      console.error('Backend connection failed:', error);
    }
  };

  const handleSendMessage = async (message) => {
    if (isLoading) return;

    // Add user message to chat
    const userMessage = { type: 'user', content: message, timestamp: Date.now() };
    setMessages(prev => [...prev, userMessage]);

    setIsLoading(true);
    setError(null);

    try {
      console.log('ðŸš€ FRONTEND: Sending message to API:', message);

      // Prepare conversation context (last 6 messages for context)
      const conversationHistory = messages.slice(-6).map(msg => ({
        role: msg.type === 'user' ? 'user' : 'assistant',
        content: msg.content
      }));

      // Include current learning path as part of context
      const contextData = {
        conversation_history: conversationHistory,
        current_learning_path: currentLearningPath,
        is_follow_up: messages.length > 0 // True if this isn't the first message
      };

      console.log('ðŸ§  FRONTEND: Sending context:', {
        history_length: conversationHistory.length,
        has_existing_path: !!currentLearningPath,
        is_follow_up: contextData.is_follow_up
      });

      // Call the career planning API with context
      const response = await careerAPI.chat(message, contextData);

      console.log('ðŸ“¦ FRONTEND: Received API response:', response);
      console.log('ðŸ—ºï¸ FRONTEND: Learning path in response:', response.data?.learning_path);

      // Add AI response to chat
      const aiMessage = { 
        type: 'ai', 
        content: response.response || 'I received your message and am processing it.',
        timestamp: Date.now() 
      };
      setMessages(prev => [...prev, aiMessage]);

      // Update learning path if available
      if (response.data?.learning_path) {
        console.log('ðŸŽ¯ FRONTEND: Updating learning path with new data:', response.data.learning_path);
        setCurrentLearningPath(response.data.learning_path);
      } else {
        console.log('âš ï¸ FRONTEND: No learning path in response - keeping existing path');
      }

      // Update backend status to connected if successful
      setBackendStatus('connected');

    } catch (error) {
      console.error('âŒ FRONTEND: Error sending message:', error);
      setError(error.message);

      // Add error message to chat
      const errorMessage = { 
        type: 'ai', 
        content: `Sorry, I encountered an error: ${error.message}. Please make sure the backend is running and try again.`,
        timestamp: Date.now() 
      };
      setMessages(prev => [...prev, errorMessage]);

      // Update backend status
      setBackendStatus('disconnected');
    } finally {
      setIsLoading(false);
    }
  };

  const renderStatusBar = () => {
    const statusConfig = {
      connected: {
        icon: <Wifi className="w-4 h-4" />,
        text: 'Connected',
        bgColor: 'bg-green-100',
        textColor: 'text-green-800',
        borderColor: 'border-green-200'
      },
      disconnected: {
        icon: <WifiOff className="w-4 h-4" />,
        text: 'Backend Disconnected',
        bgColor: 'bg-red-100',
        textColor: 'text-red-800',
        borderColor: 'border-red-200'
      },
      unknown: {
        icon: <AlertCircle className="w-4 h-4" />,
        text: 'Checking Connection...',
        bgColor: 'bg-yellow-100',
        textColor: 'text-yellow-800',
        borderColor: 'border-yellow-200'
      }
    };

    const config = statusConfig[backendStatus];

    return (
      <div className={`flex items-center justify-between px-4 py-2 border-b ${config.borderColor} ${config.bgColor}`}>
        <div className={`flex items-center space-x-2 ${config.textColor}`}>
          {config.icon}
          <span className="text-sm font-medium">{config.text}</span>
        </div>

        {backendStatus === 'disconnected' && (
          <button
            onClick={checkBackendHealth}
            className="text-sm px-3 py-1 bg-red-200 hover:bg-red-300 rounded-md transition-colors"
          >
            Retry
          </button>
        )}

        {backendStatus === 'connected' && (
          <div className="flex items-center space-x-1 text-green-700">
            <CheckCircle className="w-4 h-4" />
            <span className="text-sm">Multi-Agent System Ready</span>
          </div>
        )}
      </div>
    );
  };

  return (
    <div className="flex h-screen bg-gray-100 dark:bg-gray-900 text-gray-900 dark:text-gray-100">
      {/* Left Panel - Diagram */}
      <div className="w-1/2 flex flex-col border-r border-gray-200 dark:border-gray-700">
        {/* Header */}
        <div className="flex-shrink-0 bg-white dark:bg-gray-800 border-b border-gray-200 dark:border-gray-700 p-4">
          <h1 className="text-lg font-semibold">Career Roadmap</h1>
          <p className="text-sm text-gray-500 dark:text-gray-400">Visual representation of your career path</p>
        </div>

        {/* Diagram Area */}
        <div className="flex-1 p-4 overflow-auto bg-gray-50 dark:bg-gray-800/50">
          <CareerRoadmapFlow 
            learningPath={currentLearningPath} 
            className="w-full h-full rounded-lg border border-gray-200 dark:border-gray-700 bg-white dark:bg-gray-800"
          />
        </div>

        {/* Footer Status */}
        <div className="flex-shrink-0 bg-white dark:bg-gray-800 border-t border-gray-200 dark:border-gray-700 p-3">
          <div className="text-xs text-gray-500 dark:text-gray-400 text-center">
            {currentLearningPath ? (
              <span className="flex items-center justify-center space-x-1">
                <CheckCircle className="w-3 h-3 text-green-500" />
                <span>Interactive roadmap loaded</span>
              </span>
            ) : (
              <span className="text-gray-400 dark:text-gray-500">Send a message to generate your career roadmap</span>
            )}
          </div>
        </div>
      </div>

      {/* Right Panel - Chat */}
      <div className="w-1/2 flex flex-col bg-gray-50 dark:bg-gray-800">
        <ChatInterface
          onSendMessage={handleSendMessage}
          isLoading={isLoading}
          messages={messages}
        />
        {/* Backend Status Indicator removed from here as it's in ChatInterface now */}
      </div>
    </div>
  );
}

export default App;
